          return variables.user_id? payload.participantCreated.user_id === variables.user_id : true;
        }
      ),
    },
    participantUpdated: {
      subscribe: () => pubsub.asyncIterator("PARTICIPANT_UPDATED"),
    },
    participantDeleted: {
      subscribe: () => pubsub.asyncIterator("PARTICIPANT_DELETED"),
    },
  };

